import React, { Component, Fragment } from "react";
import { Card, Button, Container, Row, Col } from "react-bootstrap";
import graphicslogo from "../../asset/image/graphics.svg";
import weblogo from "../../asset/image/mobile.svg";
import mobilelogo from "../../asset/image/web.svg";

export default class Services extends Component {
  render() {
    return (
      <Fragment>
        <Container>
          <Row>
            <Col lg={4} md={6} sm={12}>
              <div>
                <img src={weblogo} />
              </div>
            </Col>
            <Col lg={4} md={6} sm={12}>
              <div>
                <img src={mobilelogo} />
              </div>
            </Col>
            <Col lg={4} md={6} sm={12}>
              <div>
                <img src={graphicslogo} />
              </div>
            </Col>
          </Row>
        </Container>
      </Fragment>
    );
  }
}
